  const [data, setdata] = useState([{ name: "K", age: 22, occupation: "MBBS Student" }]);
  const [num, setnum] = useState(0);
  useEffect(() => {
    console.log("Started")
    // setdata([{ name: "K", age: 22, occupation: "MBBS Student" }]);
    setnum(10);
    axios.get("http://localhost:5000/getdata").then((item) => {

      // setdata(item.data);
      item.data.forEach(element => {
        setdata([...data, element]);
      });
      console.log(item.data);
      console.log(data);
      console.log("data retrieved!");

    }).catch((err) => console.log(err));

  }, [])

  return (
    <div className="App">
      <h1>CRUD { num }</h1>
      <div>

      </div>
      <div>
        {/* <Display props={ { name: "Sahil", age: 22, occupation: "student" } } /> */ }
        {/* <Display props={ data[0] } /> */ }
        {/* // < Display props={ data[0] } /> */ }
        { data.map((value, index) => {
          return (
            <>
              < Display props={ data[index] } />

            </>
          )
        }) }
      </div>
    </div>
  );
}

export default App;
